import React, { Component } from "react";
import { Card } from 'semantic-ui-react';
import './style.css';


const ResultTile = () => (
   
        <Card.Group itemsPerRow={3}>
            <Card 
                className = "results"
                color='pink'
                label={{ as: 'a', corner: 'left', icon: 'heart' }}
                image = {this.props.img}
                href= ''
                header = ''
                description=''
            />
        </Card.Group>
        )


export default ResultTile
